import React from 'react';
import logo from '../../images/logo.svg';
import hamburger from '../../images/icon-hamburger.svg';

const Navbar = () => {
  return (
    <nav className='flex justify-between align-center p-5 bg-orange-400 relative'>
      <div className="logo-container">
        <img src = {logo} alt="logo sunny side"/>
      </div>

      <ul className='bg-white fixed w-5/6 flex flex-col justify-center items-center gap-2'>
        <li><a>About</a></li>
        <li><a>Services</a></li>
        <li><a>Projects</a></li>
        <li><a>Contact</a></li>
      </ul>

      <div className="toggle-container">
        <img src={hamburger} alt = "hamburger button"/>
      </div>

    </nav>
  )
}

export default Navbar;
